import React, { useEffect, useState } from 'react';
import api from './services/api';
import User from './components/User';





function App() {
  const [users, setUsers] = useState<IUser[]>([]);
useEffect(()=>{

  api.get<IUser[]>('/users').then(response => {
      setUsers(response.data);
  })
},[])
  return (
    <div className="App">
     {users.map(user => <User />)}
    </div>
  );

}

export default App;
